import React from "react";
import "./Card.css";

const Card = ({ title, image, status }) => {
  let statusColor = '';
  
  switch(status) {
    case 'new':
      statusColor = 'green';
      break;
    case 'in progress':
      statusColor = 'yellow';
      break;
    case 'completed':
      statusColor = 'red';
      break;
    default:
      statusColor = 'black'; // Default color
  }

  return (
    <div className="card">
      <img src={image} alt={title} />
      <div className="card-content">
        <h2>{title}</h2>
        <p style={{ color: statusColor }}>  {status}</p>
      </div>
    </div>
  );
};

export default Card;
